const express = require('express');
const membersControllers = require('../src/membersControllers');
const router = express.Router();

module.exports = router; 




//@route GET and POST 
router.route("/").get(membersControllers).post(membersControllers.createNewMember);


router.route("/:id").get(membersControllers. getMembersById);
module.exports = router; 

